import React, { Component } from 'react';
import FormMovie from './FormMovie';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      addMovie: [],
    }
  }
  render() {
    return (
      <div className="App">
        <FormMovie onSubmitForm={this.addMovie} />
      </div>
    );
  }
}

export default App;
